        super(props);
        this.state={
            localStorage:false
        }
    }


    render() {
        let home=<SignIn/>
        if(window.localStorage.getItem('logged')==='true'){
            console.log(window.localStorage.getItem('logged'))
            home=<div>
                <Header/>
                <Profile/>
            </div>
        }
        return (
            <div>
                {home}
            </div>

            );
        }
    }

    export default Home
